import React from 'react';
import { BrowserRouter as Router, Routes, Route, NavLink } from 'react-router-dom';

import HomePage from './pages/HomePage';
import AboutPage from './pages/AboutPage';
import ServicesPage from './pages/ServicesPage';
import PortfolioPage from './pages/PortfolioPage';
import ContactPage from './pages/ContactPage';

function App() {
  const activeLinkStyle = {
    color: '#1d4ed8', // primary color
    textDecoration: 'underline',
  };

  return (
    <Router>
      <div className="bg-light min-h-screen text-dark font-sans">
        <header className="sticky top-0 z-50 bg-white shadow-md">
          <nav className="container mx-auto flex items-center justify-between py-4 px-6">
            <NavLink to="/" className="text-3xl font-bold text-primary">Shyara</NavLink>
            <ul className="hidden md:flex items-center gap-8 text-lg">
              <li><NavLink to="/" style={({ isActive }) => isActive ? activeLinkStyle : undefined}>Home</NavLink></li>
              <li><NavLink to="/about" style={({ isActive }) => isActive ? activeLinkStyle : undefined}>About</NavLink></li>
              <li><NavLink to="/services" style={({ isActive }) => isActive ? activeLinkStyle : undefined}>Services</NavLink></li>
              <li><NavLink to="/portfolio" style={({ isActive }) => isActive ? activeLinkStyle : undefined}>Portfolio</NavLink></li>
              <li><NavLink to="/contact" style={({ isActive }) => isActive ? activeLinkStyle : undefined} className="bg-primary text-white px-5 py-2 rounded-lg hover:bg-blue-800 transition-colors">Contact Us</NavLink></li>
            </ul>
          </nav>
        </header>

        <main>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/about" element={<AboutPage />} />
            <Route path="/services" element={<ServicesPage />} />
            <Route path="/portfolio" element={<PortfolioPage />} />
            <Route path="/contact" element={<ContactPage />} />
          </Routes>
        </main>

        <footer className="bg-dark text-light py-8 mt-16">
          <div className="container mx-auto text-center text-gray-400">
            <p className="mb-2">Shyara â€“ Your Digital Marketing & Development Partner.</p>
            <p className="text-sm">Serving Clients Globally | Based in India</p>
            <div className="mt-4">
              <a href="mailto:hello@shyara.in" className="underline hover:text-white">hello@shyara.in</a>
              <span className="mx-2">|</span>
              <span>+91-XXXXXXXXXX</span>
            </div>
          </div>
        </footer>
      </div>
    </Router>
  );
}

export default App;
